import {Component} from "react";
import './Home.css';

class Home extends Component {
    componentDidMount() {
        console.log('Loading')

    }

    login = () => {
        window.gapi.auth2.getAuthInstance().signIn();
    };



    render() {
        return (
            <div>
                <h1>Giigke kigub</h1>

                <button onClick={this.login}>sign in</button>
                <button onClick={this.labels}>messages</button>


            </div>
        );
    }
}

export default Home;
